<script>
import { API } from "~/_config/API.js";
export default {
  data() {
    return {
      name: "",
      FinishedOrderTotalCount: 0,
      OrderTotalCount: 0,
      WaitingPayOrderTotalCount: 0,
      type: null,
      WaitingReceiveOrdertalCount: 0,
      WaitingSendingOrderTotalCount: 0,
      RefundAfterSaleOrderCount: 0,
      userInfo: {}
    };
  },
  computed: {
    user() {
      return this.$store.state.login.loginedUser;
    },
    role() {
      return this.userInfo.IsMember ? this.userInfo.Summary : "普通用户";
    }
  },
  methods: {
    getData() {
      API.orderCount({
        token: localStorage.getItem("user")
          ? JSON.parse(localStorage.getItem("user")).token
          : null
      }).then(res => {
        if (res.ResponseId == 0) {
          this.FinishedOrderTotalCount = res.Data.FinishedOrderTotalCount;
          this.OrderTotalCount = res.Data.OrderTotalCount;
          this.WaitingPayOrderTotalCount = res.Data.WaitingPayOrderTotalCount;
          this.WaitingReceiveOrdertalCount =
            res.Data.WaitingReceiveOrdertalCount;
          this.WaitingSendingOrderTotalCount =
            res.Data.WaitingSendingOrderTotalCount;
          this.RefundAfterSaleOrderCount = res.Data.RefundAfterSaleOrderCount;
        } else if (res.ResponseId == -1) {
          this.$store.commit("loginStatus/LOGOUT");
          this.$message({
            message: "登录过期，请重新登录",
            type: "error",
            duration: 1000,
            onClose: () => {
              this.$router.push({ path: "/login" });
            }
          });
        } else {
          this.$message({
            message: res.Message,
            type: "error"
          });
        }
      });
    },
    jump(index) {
      this.$router.push({
        path: "dashboard/orderCenter",
        query: {
          index: index
        }
      });
    },
    toAuth() {
      if (this.userInfo.RetailerAuthStatus == 2) {
        this.$router.push({
          path: "/authEdit"
        });
      }
      if (this.userInfo.RetailerAuthStatus == 0) {
        this.$router.push({
          path: "/authDetail"
        });
      }
      if (this.userInfo.RetailerAuthStatus == 1) {
        this.$router.push({
          path: "/authDetail"
        });
      }
      if (this.userInfo.RetailerAuthStatus == -1) {
        this.$router.push({
          path: "/authNew"
        });
      }
    },
    getUser() {
      API.getUserInfo({
        token: localStorage.getItem("user")
          ? JSON.parse(localStorage.getItem("user")).token
          : null
      }).then(res => {
        if (res.ResponseId == 0) {
          this.$nextTick(() => {
            this.userInfo = res.Data;
            this.name = this.userInfo.NickName;
          });
        } else if (res.ResponseId == -1) {
          this.$store.commit("loginStatus/LOGOUT");
          this.$message({
            message: "登录过期，请重新登录",
            type: "error",
            duration: 1000,
            onClose: () => {
              this.$router.push({ path: "/login" });
            }
          });
        } else {
          this.$message({
            message: res.Message,
            type: "error"
          });
        }
      });
    }
  },
  mounted() {
    API.authResult({
      token: localStorage.getItem("user")
        ? JSON.parse(localStorage.getItem("user")).token
        : null
    }).then(res => {
      this.type = res.Data.AuthType;
    });
    this.getData();
    this.getUser();
  }
};
</script>


